import Nam1 from "./image/anh1.jpg";
import Nam2 from "./image/anh2.jpg";
function App() {
  return (
    <div className=" justify-center">
      <Anh1 />
      <Anh2 />
    </div>
  );
}

const Anh1 = () => {
  return (
    <div
      className="h-[1000px] w-[500px]   bg-center bg-cover "
      style={{ backgroundImage: `url(${Nam1})` }}
    ></div>
  );
};

const Anh2 = () => {
  return (
    <div
      className="h-[1000px] w-[500px]   bg-center bg-cover "
      style={{ backgroundImage: `url(${Nam2})` }}
    ></div>
  );
};
export default App;
